import React from 'react'

const AddTodo = () => {

  handleSubmit = (e) => {
    e.preventDefault();
  }




  return (
    <form className="add-todo-form" onSubmit={this.handleSubmit}>
      <div className="input-button"></div>
      <input name="addInput" className="input-field" placeholder="What needs to be done?" autoComplete="off"></input>
    </form>
  )
}



export default AddTodo
